import { createWebHistory, createRouter } from 'vue-router';


const routes = [
    {
      path: '/',
      name: 'Home',
      component: () => import('@/views/Home'), // 동적 import
    },
    {
      path: '/login',
      name: 'Login',
      component: () => import('@/views/Login'),
    },
];

export const router = createRouter({
    history: createWebHistory(),
    routes,
});
